import React, { Component } from "react";
import "./navbar.css";
import {Navbar, Container} from 'react-bootstrap'


export default class navbar extends Component {
  render() {
    return (
      <div>
        <Navbar expand="lg" variant="light" bg="light">
          <Container>
            <Navbar.Brand href="#">Navbar</Navbar.Brand>
          </Container>
        </Navbar>;
      </div>
    );
  }
}
